"use strict";(self["webpackChunkpersontypetest"]=self["webpackChunkpersontypetest"]||[]).push([[765],{2765:function(e){e.exports=JSON.parse('{"type":"test","PIN":"999","questions":[{"question":"Har du et fritidsjob? (Her tæller græsslåning, babysitter og lignende også)","options":["Ja! Det er vigtigt at tjene penge selv.","Ikke noget fast.","Ja! Men det er frivilligt arbejde. Altså ulønnet.","Nej! Det har jeg ikke tid til."]},{"question":"Ved du, hvor mange penge du har hver måned?","options":["Nej, det styrer mine forældre.","Ja, jeg tjekker min konto flere gange om ugen.","Nej! Det er ret forskelligt, hvad jeg tjener.","Ja! Har helt styr på det."]},{"question":"Har du en opsparing?","options":["Ja! Selvfølgelig. Det er vigtigt at tænke på fremtiden.","Nej! Ikke rigtig. Tror nok jeg har en børneopsparing.","Ja! Selvfølgelig. Det er bedst altid at have lidt ekstra penge.","Nej, ikke noget særligt."]},{"question":"Køber du selv tøj?","options":["Ja! Hvis jeg falder over noget smart.","Nej! Får til fødselsdag og jul.","Ja &ndash; tit!","Nej! Kun når mine forældre siger det."]},{"question":"Får du lommepenge?","options":["Ja! Men uden at have pligter.","Nej! Men jeg får hjælp til tøj og transport.","Ja! Hvis jeg passer mine pligter, så kan jeg altid tjene lidt ekstra, hvis jeg vasker bil eller andet.","Ja! Men jeg har ofte brugt dem på forhånd."]},{"question":"Har du prøvet at låne penge?","options":["Ja, lidt af vennerne af og til, hvis jeg falder over noget lækkert i en butik.","Ja, mange gange.","Nej, jeg kan ikke lide at skylde nogen noget!","Nej, lige omvendt &ndash; jeg låner nogle gange ud til vennerne, men selvfølgelig mod en passende rente."]},{"question":"Hvordan kan du lide at holde ferie?","options":["Jeg ser altid, hvad der nu lige byder sig. Er frisk på det meste &ndash; bare der er gang i den.","Foretrækker storbyferier, så jeg kan shoppe!","Jeg rejser helst ikke for langt væk, for jeg vil gerne kunne passe mit job i ferien.","Jeg rejser altid sammen med min familie."]},{"question":"Laver du et budget?","options":["Ja! Så har jeg styr på tingene.","Nej. Ved ikke helt, hvad det er.","Ja! Det er vigtigt at vide, hvor mange penge der er i overskud.","Nej, jeg synes ikke, det er så vigtigt."]},{"question":"Noget nyt smart elektronik kommer på markedet. Hvad tænker du?","options":["Jeg købte den sidste model for mine egne penge, så jeg har ikke brug for en ny.","Jeg skal bruge mine penge til noget andet, og desuden kan jeg låne min fars.","Vil virkelig gerne have den, men jeg er helt flad&hellip;","Kan da godt finde på at købe den, hvis den er smart."]},{"question":"Din løn er ikke gået ind på kontoen.","options":["Holder lige et vågent øje med, om pengene kommer.","Det har jeg ikke lige opdaget.","Øv, har brug for pengene lige nu, for ellers går kontoen i minus.","Der er nok sket en fejl. Det løser sig."]},{"question":"Et par af dine venner snakker om en tur ind til byen for at shoppe. Hvad gør du?","options":["Tager med - lyder hyggeligt at hænge lidt ud.","Gider det ikke, spild af tid og penge. Foreslår i stedet at lave noget, der ikke koster noget.","Tager ikke med, skal passe mit fritidsarbejde.","God idé. Elsker at shoppe."]},{"question":"Du skylder dine forældre penge. Hvad gør du?","options":["Betaler med det samme.","Umuligt &ndash; jeg har aldrig lånt en krone af dem.","Det glemmer jeg, indtil de selv siger noget.","Det går nok, selvom jeg slet ikke betaler dem tilbage."]},{"question":"Har du madpakke med i skole?","options":["Nej, jeg vil helst købe noget frisk i kantinen.","Ja, det er for dyrt i kantinen.","Nej, jeg hader madpakker.","For det meste."]},{"question":"Køber du nogle gange ting, som du senere fortryder?","options":["Ja, jeg har rigtig meget tøj, jeg kun har brugt få gange.","Tja, har da en del forskellige ting, jeg egentlig aldrig bruger.","Det er sket, men så sælger jeg det bare.","Nej, jeg tænker, før jeg køber."]},{"question":"Du får 500 kr. i fødselsdagsgave. Hvad gør du med pengene?","options":["I banken med dem. Jeg er ved at spare op til en dyr ting, og nu mangler jeg ikke så meget.","Fedt! Så skal der shoppes.","Super! Jeg er også HELT flad.","Dejligt, men jeg ved ikke lige, hvad de skal bruges på. Mangler jo ikke rigtig noget lige nu."]},{"question":"Din bank inviterer dig til et arrangement for unge. Tager du med?","options":["Nej, har andre planer den dag.","Måske, vil lige se, hvilke områder, de har tænkt sig at behandle. Hvis det er noget med aktier, tager jeg måske med.","Nej! Det lyder kedeligt.","Det kunne egentlig være meget spændende. Vil overveje det."]},{"question":"Taler du om økonomi med dine forældre?","options":["Ja! Det er altid godt med et råd.","Nej! Kun når jeg skal låne.","Ja! Vi vender mange ting.","Nej!"]},{"question":"Du har nogle venner, som tit betaler for dig. Hvordan har du det med det?","options":["Vil helst ikke skylde nogen noget, så jeg tilbyder helt sikkert at betale næste gang.","Jeg er jo altid flad, så det er kun fair.","Det har jeg ikke lige tænkt over, men det er da super, at de gider det. På den måde har jeg flere penge til mig selv.","Umuligt, jeg betaler altid for mig selv."]},{"question":"Hvad er vigtigst, når du køber en ny mobil?","options":["Kvalitet og pris.","Kvalitet.","Mærke og kvalitet.","Pris og mærke."]},{"question":"Så kom den nye model af din yndlingsmobil. Hvad tænker du?","options":["Den er for dyr.","Lækker, den SKAL jeg bare have med det samme.","Hvor er den nice! Jeg spørger far og mor, om jeg godt må få den.","Sådan! Den har jeg sparet op til længe."]}]}')}}]);